import React from "react"

const styles = {
    li: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '1rem 1rem',
        border: '0px solid',
        borderRadius: '15px',
        background: '#fefcff',
        boxShadow: '-10px 10px 19px #c4c2c4, 10px -10px 19px #ffffff',   
        marginBottom: '1rem',
    },

    input: {
        marginRight: '1rem',
    }
};

export default function TodoItem({ todo, index }) {
    return (
    <li className='element'>
        <span>
            <input type='checkbox' style={styles.input}/>
            <strong>{ index + 1 }</strong>
            { todo.title }  
        </span>

        <button className='rm'>&times;</button>
    </li>
    )
}
